import React from "react";
import './wd.css';

export const WebProjects = () =>
  <div className="flex-container">
    <div>
    <h2>Firebase based Train Schedule</h2>
                        <p>You can check the train times, add a train, edit as well as delete a train.</p>  
                        <p>The table shows arrival time, departure time and the time color changes when the train is arriving.</p>

                        <p> Please visit Github account for more information. See home page for more details.</p>
                        <p> <a href="https://arnab156.github.io/Firebase-trainSchedule-SilverLine/">Video Overview. </a></p>
    </div>



  </div>;

  export default WebProjects;
